    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"宋体\">三、保密责任</font></span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); font-size: 9pt;\"><o:p></o:p></span>
  </p>
  <p class=\"p\" style=\"margin: 0pt 0pt 7.5pt; padding: 0pt;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1.保密资料指由一方向另一方披露的所有技术及非技术信息（包括但不限于产品资料、产品计划、价格、财务及营销规划、业务战略、客户信息、客户数据、研发 、软件硬件、API应用数据接口、技术说明、设计、特殊公式、特殊算法等）。</span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); font-size: 9pt;\"><o:p></o:p></span>
  </p>
  <p class=\"p\" style=\"margin: 0pt 0pt 7.5pt; padding: 0pt;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">2.本服务条款任何一方同意对获悉的对方之上述保密资料予以保密，并严格限制接触上述保密信息的员工遵守本条之保密义务。除非国家机关依法强制要求或上述保密资料已经进入公有领域外，接受保密资料的一方不得对外披露。</span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); font-size: 9pt;\"><o:p></o:p></span>
  </p>
  <p class=\"p\" style=\"margin: 0pt 0pt 7.5pt; padding: 0pt;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">3.本服务条款双方明确认可各自用户信息和业务数据等是各自的重要资产及重点保密信息。本服务条款双方同意尽最大的努力保护上述保密信息等不被披露。一旦发现有上述保密信息泄露事件，双方应合作采取一切合理措施避免或者减轻损害后果的产生。</span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); font-size: 9pt;\"><o:p></o:p></span>
  </p>
  <p class=\"p\" style=\"margin: 0pt 0pt 7.5pt; padding: 0pt;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">4.本条款不因本服务条款的终止而失效。</span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); font-size: 9pt;\"><o:p></o:p></span>
  </p>
  <p class=\"p\" style=\"margin: 0pt 0pt 7.5pt; padding: 0pt; text-align: center;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); font-size: 9pt;\"><o:p>&nbsp;</o:p></span></p>
  <h4 align=\"center\" style=\"line-height: 13.5pt; color: rgb(103, 106, 108); margin-top: 0pt; margin-right: 0pt; margin-bottom: 6pt; padding: 0pt; text-align: center; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"宋体\">四、</font></span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"宋体\">违约责任</font></span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span>
  </h4>
  <h4 style=\"color: rgb(103, 106, 108);\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">1.&nbsp;</span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"宋体\">本服务条款任何一方违约均须依法承担违约责任。</font></span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span>
  </h4>
  <h4 style=\"color: rgb(103, 106, 108);\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">2.您理解，鉴于计算机、互联网的特殊性，下述情况不属于狐豆违约：</span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span>
  </h4>
  <h4 style=\"color: rgb(103, 106, 108); text-indent: 21pt;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">A.狐豆在进行服务配置、维护、升级时，需要短时间中断服务；</span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span>
  </h4>
  <h4 style=\"color: rgb(103, 106, 108); text-indent: 21pt;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">B.狐豆提供的服务涉及到互联网及相关信息等服务，可能会受到 Internet不稳定因素的影响。因此服务存在因上述不可抗力、计算机病毒或黑客攻击、系统不稳定、用户所在位置、用户关机、通信网络、Internet等原因等造成您访问狐豆服务速度下降或无法使用；</span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span>
  </h4>
  <h4 style=\"color: rgb(103, 106, 108);\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">3.由于您的故意或过失导致遭受损失的，狐豆不承担任何责任。</span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span>
  </h4>
  <h4 style=\"color: rgb(103, 106, 108);\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">4.如因狐豆原因，造成您连续72小时不能正常使用服务的，您可以终止服务，但非狐豆控制之内的原因引起的除外。</span><b><span style=\"font-family: 宋体; color: rgb(0, 0, 0); font-size: 9pt;\"><o:p></o:p></span></b>
  </h4>
  <p class=\"p\" style=\"margin: 0pt 0pt 7.5pt; padding: 0pt; text-align: center;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"宋体\">　　</font></span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span>
  </p>
  <p class=\"p\" align=\"center\" style=\"margin: 0pt 0pt 7.5pt; padding: 0pt;\">
    <span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"宋体\">五、</font></span><span style=\"font-family: 宋体; color: rgb(0, 0, 0); letter-spacing: 0pt; font-size: 9pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"宋体\">附则</font></span>
  </p>
  <p class=\"p\" style=\"margin-top:0.0000pt;margin-right:0.0000pt;margin-bottom:7.5000pt;margin-left:0.0000pt;padding:0pt 0pt 0pt 0pt ;mso-pagination:widow-orphan;mso-line-height-alt:12pt;\">
